import MyButton from './components/UI/MyButton/MyButton';
import './style/App.css';

function App() {

  return (
    <div className="App">
      <h1 style={{marginTop: '10px'}} className='header'>TO-DO LIST</h1>
      <div className='to-do-item'>
        <div className='to-do-item-content'>
          <strong>1. To-do item</strong>
          <div>Description</div>
        </div>
          <MyButton>Delete</MyButton>
      </div>
      <div className='to-do-item'>
        <div className='to-do-item-content'>
          <strong>1. To-do item</strong>
          <div>Description</div>
        </div>
          <MyButton></MyButton>
      </div>
    </div>
  );
}

export default App;
